import style from './Footer.module.scss';

import logo from '../../assets/img/logos/linkedin.png';
import github from '../../assets/img/logos/github.png';
import gmail from '../../assets/img/logos/gmail.png';
import instagram from '../../assets/img/logos/instagram.png';

export default function Footer() {
    return (
        <footer className={style.footer}>
            <div title='Linkedin' className={style.logo}>
                <img src={logo} alt="" />
            </div>
            <div title='GitHub' className={style.logo}>
                <img src={github} alt="" />
            </div>
            <div title='Gmail' className={style.logo}>
                <img src={gmail} alt="" />
            </div>
            <div title='Instagram' className={style.logo}>
                <img src={instagram} alt="" />
            </div>
        </footer>
    );
}
